import React from 'react';

function Footer() {
  return (
    <footer id="footer" style={{ backgroundColor: '#333', color: 'white', padding: '10px', textAlign: 'center' }}>
      <p>&copy; 2025 Todos os direitos reservados.</p>
    </footer>
  );
}

export default Footer;
